    xml += '<F1_FORNECE>' + hAPI.getCardValue("codFornecedor") + '</F1_FORNECE>' // codigo do fornecedor
    xml += '<F1_LOJA>' + hAPI.getCardValue("lojFornecedor") + '</F1_LOJA>' // loja do fornecedor
