function afterTaskSave(colleagueId, nextSequenceId, userList) {

    var ATIVIDADE = getValue("WKNumState");

    if (ATIVIDADE == INICIO || ATIVIDADE == INICIO1) {

        var constraintDs_filial1 = DatasetFactory.createConstraint('CODIGO', hAPI.getCardValue('codFilial'), hAPI.getCardValue('codFilial'), ConstraintType.MUST);
        var datasetDs_filial = DatasetFactory.getDataset('ds_filial', null, new Array(constraintDs_filial1), null);

        var constraintDs_fornecedor1 = DatasetFactory.createConstraint('CODIGO', hAPI.getCardValue('codFornecedor'), hAPI.getCardValue('codFornecedor'), ConstraintType.MUST);
        var datasetDs_fornecedor = DatasetFactory.getDataset('ds_fornecedor', null, new Array(constraintDs_fornecedor1), null);

        hAPI.setCardValue("codSolicitacao", getValue("WKNumProces"));
        hAPI.setCardValue("nomeFilial", datasetDs_filial.getValue(0, "FILTRO"));
        hAPI.setCardValue("nomeFornecedor", datasetDs_fornecedor.getValue(0, "FILTRO"));

    }

    if (ATIVIDADE == INCONSISTENCIA_COMPRAS) {
        hAPI.setCardValue("passouAtvInsatifacao", "sim");
    }

    if ((nextSequenceId == APROV_SOLICITANTE || nextSequenceId == '13') && hAPI.getCardValue("decisaoAprovSol") != "Sim") {
        notificacaoEncerramento(hAPI.getCardValue('emailSolicitante'), hAPI.getCardValue('solicitante'))
    }

    var unidade = hAPI.getCardValue("nomeFilial");

    var dataVencimento = hAPI.getCardValue("dataVencimento");

    var dataVencimentoSemTrava = hAPI.getCardValue("dataVencimentoSemTrava");

    var dataFormatada = '';

    var dataFormatadatrava = '';



    if (unidade == undefined) {

        unidade = ""

    }



     if (dataVencimento != '') {



         hAPI.setCardValue("campoIdentificador", 'N -' + unidade);

         var dataFormatada = dataVencimento.split('/')[2];

         dataFormatada += '/' + dataVencimento.split('/')[1];

         dataFormatada += '/' + dataVencimento.split('/')[0];



         hAPI.setCardValue("campoIdentificador", dataFormatada + ' - N - ' + unidade);



     } else if(dataVencimentoSemTrava != ''){

        var dataFormatadatrava = dataVencimentoSemTrava.replace("-", "/");



        hAPI.setCardValue("campoIdentificador", dataFormatadatrava + ' - N - ' + unidade);



         

     } else{

        hAPI.setCardValue("campoIdentificador", 'N -' + unidade);  



     }
}


function notificacaoEncerramento(emailSolicitante, solicitante) {
    var filter = new Array()
    filter.push(DatasetFactory.createConstraint('SOLICITACAO', getValue("WKNumProces"), '', ConstraintType.MUST))
    filter.push(DatasetFactory.createConstraint('SOLICITANTE', solicitante, '', ConstraintType.MUST))
    filter.push(DatasetFactory.createConstraint('EMAIL_SOLICITANTE', emailSolicitante, '', ConstraintType.MUST))
    filter.push(DatasetFactory.createConstraint('PROCESSO', getValue("WKDef"), '', ConstraintType.MUST))
    var ds_envioEmailEncerramento = DatasetFactory.getDataset('ds_envioEmailEncerramento', null, filter, null);
}

function GETSLA() {
    var active = getValue('WKNumState')

    if (active == 0 || active == getStartActive().getValue(0, "processStatePK.sequence")) {

        var codigo = hAPI.getCardValue('COD_SOLICITACAO');
        var dataSLA;
        // verifica se o processo foi iniciado com o campo COD_SOLICITACAO para consultar o sla
        // do contrario consulta o sla do processo default
        if (codigo != '' && codigo != undefined) {
            dataSLA = getSlaById(codigo)
            if (dataSLA.rowsCount <= 0) {
                dataSLA = getSlaDefault()
                hAPI.setCardValue('ISDEFAULT', '' + true)
            }
        } else {
            dataSLA = getSlaDefault();
            hAPI.setCardValue('ISDEFAULT', '' + true)
        }
        // valida se o chamado possui SLA
        if (dataSLA.rowsCount > 0) {

            // seta o valor id do documento e a versao
            hAPI.setCardValue('COD_SOLICITACAO', '' + dataSLA.getValue(0, 'documentid'))
            hAPI.setCardValue('VERSAO', '' + dataSLA.getValue(0, 'version'))
            // converte a string JsonSla em objeto e popula os campos
            dataSLA = dataSLA.getValue(0, 'jsonSLA')
            dataSLA = JSON.parse(dataSLA)
            hAPI.setCardValue('SLA_TOTAL', '' + dataSLA.slaTotal)


            for (var key in dataSLA.SLA) {
                var sla = dataSLA.SLA[key]
                hAPI.setCardValue('SLA' + sla.codAtividade, sla.sla)
            }

        } else {

            throw "Não foi encontrado um registro de SLA para essa solicitacao," +
                " portanto ela nao pode ser iniciada!!! Contate a equipe de melhorias Continuas"

        }

    }
}

// consulta o sla pelo codigo da solicitaçã
function getSlaById(id) {

    var cons = []
    cons.push(DatasetFactory.createConstraint('metadata#active', 'true', 'true', ConstraintType.MUST))
    cons.push(DatasetFactory.createConstraint('isActive', 'true', 'true', ConstraintType.MUST))
    cons.push(DatasetFactory.createConstraint('documentid', id, id, ConstraintType.MUST))
    return DatasetFactory.getDataset('ds_ficharioSLA', null, cons, null);
}
// consulta o SLA pelo codigo do processo
function getSlaDefault() {
    var codProcess = getValue("WKDef");

    var cons = []
    cons.push(DatasetFactory.createConstraint('metadata#active', 'true', 'true', ConstraintType.MUST))
    cons.push(DatasetFactory.createConstraint('idProcesso', codProcess, codProcess, ConstraintType.MUST))
    cons.push(DatasetFactory.createConstraint('isActive', true, true, ConstraintType.MUST))
    cons.push(DatasetFactory.createConstraint('isDefault', true, true, ConstraintType.MUST))
    return DatasetFactory.getDataset('ds_ficharioSLA', null, cons, null);

}
// consulta qual o Id da atividade inicial do fluxo()
function getStartActive() {
    var idProcess = getValue("WKDef")
    var versionProcess = getValue("WKVersDef")

    var cons = []
    cons.push(DatasetFactory.createConstraint('initialState', 'true', 'true', ConstraintType.MUST))
    cons.push(DatasetFactory.createConstraint('processStatePK.processId', idProcess, idProcess, ConstraintType.MUST))
    cons.push(DatasetFactory.createConstraint('processStatePK.version', versionProcess, versionProcess, ConstraintType.MUST))
    return DatasetFactory.getDataset('processState', null, cons, null);
}

